import * as React from 'react';
import { Text, View } from 'react-native';
import { Ionicons } from '@expo/vector-icons';
import { NavigationContainer } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import Header from './src/Header';
import Mission from './src/Screen/Mission';
import Product from './src/Screen/Product';
import Contact from './src/Screen/Contact';
const Tab = createBottomTabNavigator();

export default function App() {
  return (
    <NavigationContainer>
      <Tab.Navigator
        screenOptions={({ route }) => ({
          tabBarIcon: ({ focused, color, size }) => {
            if (route.name === 'Home') {
              return (
                // <ion-icon name="home"></ion-icon>
                <Ionicons
                name={focused ? 'ios-home' : 'ios-home'}
                  size={size}
                  color={color}
                />
              );
            } 
            else if (route.name === 'Mission') {
              return (
                <Ionicons
                  name={focused ? 'ios-list-box' : 'ios-list'}
                  size={size}
                  color={color}
                />
                
              );
              
            }
            else if (route.name === 'Product') {
              return (
                <Ionicons
                  name={focused ? 'ios-cog' : 'ios-cog'}
                  size={size}
                  color={color}
                />
                
              );
              
            }

            else if (route.name === 'Contact-us') {
              return (
                <Ionicons
                  name={focused ? 'ios-call' : 'ios-call'}
                  size={size}
                  color={color}
                />
                
              );
              
            }

          },
        })}
        tabBarOptions={{
          activeTintColor: '#1f2d61',
          inactiveTintColor: 'gray',
        }}
      >
        <Tab.Screen name="Home" component={Header} 
        // options={{ tabBarBadge: 3 }}
        />
        <Tab.Screen name="Mission" component={Mission} />
        <Tab.Screen name ="Product" component={Product}/>
        <Tab.Screen name ="Contact-us" component={Contact}/>
      </Tab.Navigator>
    </NavigationContainer>
  );
}

